import React from 'react';
import './index.css';

const Header=()=>{
    return (
        <React.Fragment>
            <div className>
                <div className="bg-image">
                    <h1>hello</h1>
                </div>
                <div className='main-header'>
                    <h1>Welcome to Gkeep</h1>
                        
                </div>
            </div>
            
        </React.Fragment>
    )


}

export default Header;
